<template>
<div class="result" v-click="bgClick">
  <div class="cont">
    <div class="tit">{{type===1?'练习':'挑战'}}结果</div>
    <div class="det">
      <p v-show="bus.name">挑战人：{{bus.name}}</p>
      <p v-show="title!=='练习'">挑战模式：{{title}}</p>
      <p>正确位数：{{num}}位</p>
      <p>{{type===1?'练习':'挑战'}}时间：{{timeShow}}</p>
    </div>
    <div class="btns">
      <template v-if="type===1">
        <a v-click="restart" class="button">再练一次</a>
        <!--<a v-click="toChallenge" class="button">开始比赛</a>-->
        <a v-click="close" class="button gray">返回</a>
      </template>
      <template v-else>
        <a v-click="restart" class="button">重新挑战</a>
        <a v-click="toPractice" class="button">开始练习</a>
        <a v-click="close" class="button gray">返回</a>
      </template>
    </div>
  </div>
</div>
</template>

<script>
    export default {
      props: ['type', 'num', 't', 'bus', 'title'],
      methods: {
        close () {
          this.$emit('close')
        },
        toPractice () {
          this.$emit('close')
          this.$router.push({name: 'Practice'})
        },
        toChallenge (e) {
          this.$emit('close')
          this.$router.push({name: 'Challenge'})
          e.preventDefault()
        },
        bgClick (e) {
          if (e.target.classList.contains('result')) {
            this.close()
            console.log(123)
          }
        },
        restart () {
          this.$emit('close')
          this.$emit('restart')
        },
        numFill (number) {
          if (number < 10) {
            return '0' + number
          }
          return number
        }
      },
      computed: {
        timeShow: function () {
          let {t} = this
          if (this.bus.timeType * 1 === 1 && this.type === 2) {
            t = this.bus.timeCount - t
          }
          return this.numFill(~~(t / 60)) + '分' + this.numFill(t % 60) + '秒'
        }
      }
    }
</script>

